Object* scheme::getBuiltinSymbols() {
    static Object builtinSymbols[8291];
    static bool initialized = false;
    if (!initialized) {
        for (int i = 0; i < 8291; i++) {
            builtinSymbols[i] = Symbol::add(symbolStrings[i]);
        }
        initialized = true;
    }
    return builtinSymbols;
}
